import React from 'react'
import styled from "styled-components";


const Ad = () => {
    return (
      <Body>

<p class="fas fa-user-circle">
</p>

<h>Business &nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Advertising &nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Resoures &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Blog</h>
<hr/><br/><br/><br/><br/><br/><br/>

<h>Grow your  bussiness with assberry ads </h>

<br/><br/><br/><br/><br/><br/>
<h>CREATE AN ADS </h>
<br/><br/><br/><br/><br/><br/>
<h>ashberry Abs drive result<i class="fas fa-image"></i> </h>
<br/><br/><br/><br/><br/><br/>

<h>- easily crate and  manage ads </h>


      </Body>
    )
 }
const Body = styled.nav`
p{
    font-size:73px;
    padding-left:34px;
}
h{
    font-size:33px;
    padding-left:84px;
}

i{
    font-size:234px;
}
;`
export default Ad;
